import React from "react";
import PizzaCard from "./PizzaCard";

const PizzaCardList = ({ pizzas, category }) => {
  const lespizzas = pizzas[2];
  const cardComponent = lespizzas.map((pizza) => {
    return (
      <PizzaCard
        key={pizza.id}
        price={pizza.price}
        name={pizza.name}
        unit={pizza.unit}
        pizza={pizza}
      />
    );
  });
  return <div className="AllSabores">{cardComponent}</div>;
};

export default PizzaCardList;
